// src/main.ts
var NoteToMpPlugin = class extends import_obsidian10.Plugin {
  constructor(app, manifest) {
    super(app, manifest);
    AssetsManager.setup(app, manifest);
    this.assetsManager = AssetsManager.getInstance();
  }
  async onload() {
    console.log("Loading Note to MP");
    setVersion(this.manifest.version);
    uevent("load");
    await this.loadSettings();
    await this.assetsManager.loadAssets();
    this.registerView(
      VIEW_TYPE_NOTE_PREVIEW,
      (leaf) => new NotePreview(leaf)
    );
    const ribbonIconEl = this.addRibbonIcon("clipboard-paste", "\u590D\u5236\u5230\u516C\u4F17\u53F7", (evt) => {
      this.activateView();
    });
    ribbonIconEl.addClass("note-to-mp-plugin-ribbon-class");
    this.addCommand({
      id: "open-note-preview",
      name: "\u590D\u5236\u5230\u516C\u4F17\u53F7",
      callback: () => {
        this.activateView();
      }
    });
    this.addSettingTab(new NoteToMpSettingTab(this.app, this));
  }
  onunload() {
  }
  async loadSettings() {
    NMPSettings.loadSettings(await this.loadData());
  }
  async saveSettings() {
    await this.saveData(NMPSettings.allSettings());
  }
  async activateView() {
    const { workspace } = this.app;
    let leaf = null;
    const leaves = workspace.getLeavesOfType(VIEW_TYPE_NOTE_PREVIEW);
    if (leaves.length > 0) {
      leaf = leaves[0];
    } else {
      leaf = workspace.getRightLeaf(false);
      await (leaf == null ? void 0 : leaf.setViewState({ type: VIEW_TYPE_NOTE_PREVIEW, active: false }));
    }
    if (leaf)
      workspace.revealLeaf(leaf);
  }
};
